import React, { useEffect } from 'react'
import { useDispatch, useSelector } from 'react-redux' 
import CategoryData from '../components/CategoryData'
import Header from '../components/Header'
import Footer from '../components/Footer'
import { getProducts } from '../store/actions/products'
import { productCategory } from '../store/actions/productCategory'
import { useParams } from 'react-router-dom'



export default function Category() {

const dispatch = useDispatch()
const category = useSelector((state) => state.category.catProducts)
const params = useParams()



useEffect(() => {
dispatch(productCategory())

}, [])





  return (
    <div>
<Header/>
<CategoryData/>

<div className='cardStyle'>

{category.map((products) => (
            <div key={products.id} className="card">
              <img className="card-img-top" src={products.image} alt="Card image cap" />
              <div className="card-body">
                <h5 className="card-title">Brand: {products.title}</h5>
                <p className="card-text desc">Description: {products.description}</p>
                <p className="card-text">Price: {products.price + '$'}</p>
                <p className="card-text">Quantity: {products.quantity}</p>
              </div>
            </div>

))}

</div>


<Footer/>
        </div>
  )
}
